<template>
	<view class="todo-container" :style="{height:wrapperHeight+'px'}" @touchmove.prevent>
		<view class="todo-header">
			<view class="todo-header-left">
				<text class="total">共{{total}}条</text>
			</view>
			<view class="todo-header-right">
				<text :class="{active:filter===0}" @click="filterChange(0)">全部</text>
				<text :class="{active:filter===1}" @click="filterChange(1)">待办</text>
				<text :class="{active:filter===2}" @click="filterChange(2)">已完成</text>
			</view>
		</view>
		<view class="list-wrapper" :style="{height:contentHeight+'px'}" v-if="list.length && total">
			<load-refresh ref="loadRefresh" :heightReduce="86" :pageNo="1" :totalPageNo="1" @refresh="refresh">
				<view slot="content-list">
					<view class="todo-list">
						<uni-swipe-action>
							<uni-swipe-action-item class="swipe-item" :options="options" v-for="(itm,idx) in list" :key="itm.id" @click="swipeClick($event, itm)">
								<view :class="['todo-item',{finish:itm.status===2}]">
									<view class="checkbox" @click="toggleStatus(itm,idx)"></view>
									<input type="text" spellcheck="false" :disabled="itm.status===2" v-model="itm.content" @change="contentChange(itm,idx)"
									 v-if="itm.status===1">
									<text class="plain-text" v-else>{{itm.content}}</text>
									<view :class="['star',{light:itm.star}]" @click="star(itm,idx)"></view>
								</view>
							</uni-swipe-action-item>
						</uni-swipe-action>
					</view>
				</view>
			</load-refresh>
		</view>
		<image mode="aspectFit" class="todo-nodata" src="../static/img/nodata.png" v-else></image>
		<view :class="['todo-input', {open:inputStatus}]" v-show="showInput" v-click-outside="hideTodoInput">
			<view class="input-wrapper">
				<input type="text" spellcheck="false" placeholder="请输入内容" v-model="todoContent">
				<button type="button" class="btn-add-todo" :disabed="loading" @click="add">确定</button>
			</view>
		</view>
		<view :class="['add-todo', {open:inputStatus}]" @click="toggleTodoInput"></view>
	</view>
</template>

<script>
	import loadRefresh from '@/components/load-refresh/load-refresh.vue'
	import uniSwipeAction from '@/components/uni-swipe-action/uni-swipe-action.vue';
	import uniSwipeActionItem from '@/components/uni-swipe-action-item/uni-swipe-action-item.vue';
	export default {
		name: 'todo',
		components: {
			loadRefresh,
			uniSwipeAction,
			uniSwipeActionItem
		},
		data() {
			return {
				loading: false,
				list: [], //列表数据
				userInfo: {}, //用户信息
				wrapperHeight: null, //内容高度
				contentHeight: null,
				todoContent: '', //todo内容
				limit: 30, //最大条数
				filter: 0, //筛选条件，0-全部;1-未完成;2-已完成
				options: [{
					text: '',
					type: 'delete',
					disabled: false,
					style: {
						backgroundColor: '#f99228'
					}
				}],
				showInput: false, //是否显示输入框
				inputStatus: false, //输入框开启状态
			}
		},
		onShow() {
			this.$checkLogin()
			this.userInfo = uni.getStorageSync('user-info')
			this.getList()
		},
		onHide() {
			this.hideTodoInput(true)
		},
		mounted() {
			// #ifdef MP-WEIXIN
			this.wrapperHeight = uni.getSystemInfoSync().windowHeight
			// #endif
			// #ifdef H5
			this.wrapperHeight = uni.getSystemInfoSync().windowHeight
			// #endif
			this.countHeight()
		},
		computed: {
			total() {
				return this.filter === 0 ? this.list.length : this.list.filter(cur => cur.status === this.filter).length
			}
		},
		methods: {
			countHeight() {
				//#ifdef MP-WEIXIN
				const queryWx = wx.createSelectorQuery()
				queryWx.select('.todo-header').boundingClientRect()
				queryWx.exec(data => {
					// console.log('打印高度', data[0]);
					this.contentHeight = this.wrapperHeight - data[0].height
				})
				//#endif

				//#ifdef H5
				const queryH5 = uni.createSelectorQuery().in(this);
				queryH5.select('.todo-header').boundingClientRect(data => {
					// console.log(data)
					this.contentHeight = this.wrapperHeight - data.height
				}).exec();
				//#endif
			},
			// 获取Todo列表
			getList() {
				let param = {}
				this.filter ? param.status = this.filter : null;
				this.$request({
					path: '/api/todox/list',
					data: param,
				}).then(res => {
					this.list = res.data.list
				})
			},
			// 筛选条件，type类型
			filterChange(type) {
				this.hideTodoInput();
				this.filter = type;
				this.getList();
			},
			// 播放提示音
			playAudio() {
				if (!this.userInfo.playSound) return false
				const innerAudioContext = uni.createInnerAudioContext(); //创建播放器对象
				innerAudioContext.obeyMuteSwitch = false;
				// innerAudioContext.src = '../static/media/ding.wav';
				innerAudioContext.src = 'https://www.bbchin.com/todox/static/media/ding.wav';
				innerAudioContext.onCanplay(() => {
					innerAudioContext.play(); //执行播放
				});
				innerAudioContext.onError((res) => {
					console.log(res);
				});
			},
			// 添加
			add() {
				if (this.loading) return false;
				if (!this.todoContent.trim()) {
					this.$toast('请先输入内容!')
					return false;
				}
				this.loading = true
				this.$loading.show('正在添加…')
				this.$request({
					path: '/api/todox/add',
					method: 'POST',
					data: {
						content: this.todoContent
					},
				}).then(res => {
					this.loading = false
					this.$loading.hide()
					this.hideTodoInput();
					this.getList();
				}).catch(err => {
					this.loading = false
					this.$loading.hide()
				})
			},
			// 删除
			del(id) {
				this.loading = true
				this.$loading.show('正在删除…')
				this.$request({
					path: '/api/todox/delete',
					method: 'POST',
					data: {
						id
					},
				}).then(res => {
					this.loading = false
					this.$loading.hide()
					this.hideTodoInput();
					this.getList();
				}).catch(err => {
					this.loading = false
					this.$loading.hide()
				})
			},
			// 切换状态
			toggleStatus(item, index) {
				item.status === 1 && this.playAudio();
				this.$set(this.list[index], 'status', item.status === 1 ? 2 : 1);
				this.$request({
					path: '/api/todox/update',
					method: 'POST',
					data: {
						id: item.id,
						status: item.status
					},
				}).then(res => {
					this.getList();
				})
			},
			// 修改内容
			contentChange(item, index) {
				this.$request({
					path: '/api/todox/update',
					method: 'POST',
					data: {
						id: item.id,
						content: item.content
					},
				}).then(res => {
					// this.getList();
				})
			},
			// star置顶
			star(item, index) {
				if (item.status === 2) return false
				this.$request({
					path: '/api/todox/update',
					method: 'POST',
					data: {
						id: item.id,
						star: !item.star
					},
				}).then(res => {
					this.getList();
				})
			},
			// 显示/隐藏input框
			toggleTodoInput() {
				if (!this.inputStatus) {
					if (this.list.length === this.limit) {
						this.$toast(`列表已超过${this.limit}条限制，请删除后再添加！`)
						return false;
					}
					this.showInput = true;
					setTimeout(() => {
						this.inputStatus = true
					}, 100)
				} else {
					this.hideTodoInput();
				}

			},
			// 隐藏input框
			hideTodoInput(immediate) {
				if (immediate === 1) {
					this.inputStatus = false
					this.showInput = false;
					this.todoContent = '';
				} else {
					if (!this.inputStatus) return false;
					this.inputStatus = false
					setTimeout(() => {
						this.showInput = false;
						this.todoContent = '';
					}, 300)
				}
			},
			// 下拉刷新
			refresh() {
				this.getList()
			},
			// 滑动菜单
			swipeClick(data, item) {
				// console.log(data, item);
				const label = data.content.type
				if (label === 'delete') {
					this.del(item.id)
				}
			}
		}
	}
</script>

<style lang="scss">
	$blue:#40a0ea;

	.todo-container {
		display: flex;
		flex-direction: column;
		width: 100%;
		overflow: hidden;
		background: #f5f5f5;
	}

	.todo-header {
		flex-shrink: 0;
		position: relative;
		z-index: 2;
		display: flex;
		height: 88rpx;
		padding: 0 14px;
		align-items: center;
		background: #fff;
		box-shadow: 0 1px 2px 1px #dedede;

		.todo-header-left {
			width: 100%;

			text {
				cursor: pointer;
				margin-right: 8px;
				font-size: 28rpx;
				color: #333;
			}

			.total {
				cursor: default;
				color: #666;
			}
		}

		.todo-header-right {
			flex-shrink: 0;
			display: flex;

			text {
				cursor: pointer;
				margin-left: 6px;
				height: 50rpx;
				padding: 0 8px;
				line-height: 50rpx;
				font-size: 28rpx;
				color: #333;
				border-radius: 50px;

				&.active {
					color: #fff;
					background: $blue;
				}
			}
		}
	}

	.list-wrapper {
		position: relative;
		overflow: auto;
		background: url(data:image/jpeg;base64,) no-repeat top center;
		background-attachment: fixed;
		-webkit-background-size: cover;
		background-size: cover;
	}

	.todo-list {
		padding-bottom: 260rpx;

		/deep/.uni-swipe_button {
			cursor: pointer;
			padding: 0 30px !important;
			background: url(data:image/png;base64,) no-repeat center;
			-webkit-background-size: 36rpx auto;
			background-size: 36rpx auto;
		}

		.todo-item {
			display: flex;
			width: 100%;
			height: 108rpx;
			box-sizing: border-box;
			align-items: center;
			padding: 32rpx 40rpx;
			border-bottom: 1px solid #eee;

			.checkbox {
				flex-shrink: 0;
				position: relative;
				cursor: pointer;
				box-sizing: border-box;
				width: 20px;
				height: 20px;
				margin-right: 10px;
				background: #fff;
				border: 3px solid $blue;
				border-radius: 50%;
			}

			input {
				width: 100%;
				font-size: 28rpx;
				color: #333;
			}

			.plain-text {
				width: 100%;
				padding-right: 60rpx;
				font-size: 28rpx;
				color: #b3b3b3;
				overflow: hidden;
				text-overflow: ellipsis;
				white-space: nowrap;
				text-decoration: line-through;
			}

			.star {
				flex-shrink: 0;
				cursor: pointer;
				box-sizing: border-box;
				width: 60rpx;
				height: 60rpx;
				margin-left: 10px;
				background-image: url(../static/img/ico_star.png);
				background-repeat: no-repeat;
				background-position: center;
				-webkit-background-size: 40rpx auto;
				background-size: 40rpx auto;

				&.light {
					background-image: url(../static/img/ico_star_active.png);
				}
			}

			&.finish {
				background: #f5f5f5;

				.checkbox {
					border-color: #b3b3b3;

					&:before {
						position: absolute;
						content: '';
						width: 10px;
						height: 10px;
						top: 0;
						bottom: 0;
						left: 0;
						right: 0;
						margin: auto;
						background: #b3b3b3;
						border-radius: 50%;
					}
				}

				.light {
					background-image: url(../static/img/ico_star_active_grey.png);
				}
			}
		}
	}

	.todo-nodata {
		display: block;
		width: 44%;
		margin: 140rpx auto 0;
	}

	.todo-input {
		position: fixed;
		left: 20px;
		right: 20px;
		bottom: calc(var(--window-bottom) + 60rpx);
		z-index: 2;
		transform: scale(0);
		transition: all .3s;

		&:before {
			position: absolute;
			left: 0;
			right: 0;
			z-index: 1;
			bottom: -6px;
			margin: 0 auto;
			content: '';
			width: 14px;
			height: 14px;
			background: #fff;
			transform: rotate(45deg);
			box-shadow: 1px 0 10px 2px #ddd;
		}

		&:after {
			position: absolute;
			left: 0;
			right: 0;
			z-index: 3;
			bottom: -5px;
			margin: 0 auto;
			content: '';
			width: 14px;
			height: 14px;
			background: #fff;
			transform: rotate(45deg);
		}

		&.open {
			bottom: calc(var(--window-bottom) + 180rpx);
			transform: scale(1)
		}
	}

	.input-wrapper {
		position: relative;
		z-index: 2;
		display: flex;
		align-items: center;
		padding: 8px 12px 8px 20px;
		background: #fff;
		border-radius: 40px;
		box-shadow: 1px 0 10px 2px #ddd;

		input {
			width: 100%;
			font-size: 28rpx;
		}

		.btn-add-todo {
			flex-shrink: 0;
			height: 70rpx;
			margin-left: 10px;
			line-height: 70rpx;
			font-size: 28rpx;
			color: #fff;
			background: #6cbfff;
			border: none;
			outline: none;
			border-radius: 40px;
		}
	}

	.add-todo {
		cursor: pointer;
		position: fixed;
		z-index: 4;
		left: 0;
		right: 0;
		bottom: calc(var(--window-bottom) + 30rpx);
		width: 120rpx;
		height: 120rpx;
		margin: 0 auto;
		text-align: center;
		font-size: 72rpx;
		color: #fff;
		-webkit-tap-highlight-color: transparent;
		background: #6cbfff url(data:image/png;base64,) no-repeat center;
		-webkit-background-size: 44% auto;
		background-size: 44% auto;
		box-shadow: 0 0 16px 2px #6fbaf3;
		border-radius: 50%;
		transition: all .3s;

		&.open {
			transform: rotate(135deg);
		}
	}
</style>
